import React, { Component } from 'react'
import Navbar from "../components/helpers/Navbar"

export default class Home extends Component {
  render() {
    return (
      <div>
        <Navbar main="home" link1="HOME" link2="ABOUT" link3="SIGN UP" link4="LOGIN"/>
        <img class="ui fluid image" src="https://scontent-dfw5-1.xx.fbcdn.net/v/t1.0-9/49432712_2192782434319245_2338435896820367360_n.png?_nc_cat=107&_nc_ht=scontent-dfw5-1.xx&oh=c7042872be73e2349e533c6be23fab80&oe=5CBB07E9"/>
      </div>
    )
  }
}
